import {BondInfo} from "../../listener/types";
import fs from "fs";
import {PutObjectCommand} from '@aws-sdk/client-s3'
import {toBN, toChecksumAddress} from 'web3-utils'
import {getTokenInfo} from "../../listener/zcb";
import {shorten} from "../utils/address";
import {formatTime} from "../utils/dates";
import s3Client from "../../db/s3-client";


const bucketName = 'storage.amet.finance'

async function updateContractMetaInfo(chainId: number, bondInfo: BondInfo) {
    const {
        _id,
        issuer,
        investmentToken,
        investmentTokenAmount,
        interestToken,
        interestTokenAmount,
        redeemLockPeriod
    } = bondInfo;

    const investmentTokenInfo = await getTokenInfo(chainId, investmentToken)
    const interestTokenInfo = await getTokenInfo(chainId, interestToken);

    const name = `${investmentTokenInfo.symbol}/${interestTokenInfo.symbol}`;
    const investmentAmount = toBN(investmentTokenAmount).div(toBN(10).pow(toBN(investmentTokenInfo.decimals))).toString();
    const interestAmount = toBN(interestTokenAmount).div(toBN(10).pow(toBN(interestTokenInfo.decimals))).toString();
    const issuanceDate = new Date(bondInfo.issuanceDate * 1000).toLocaleDateString().replaceAll('/', '.')

    const image = NFT_GENERATOR(
        name,
        `${investmentAmount} ${investmentTokenInfo.symbol}`,
        `${interestAmount} ${investmentTokenInfo.symbol}`,
        formatTime(redeemLockPeriod, true),
        shorten(issuer),
        issuanceDate)

    fs.writeFileSync('output.svg', image, {encoding: "utf-8"})
    const file = fs.readFileSync("output.svg");

    const objectKey = `images/${toChecksumAddress(issuer)}.svg`

    const commandImage = new PutObjectCommand({
        Bucket: bucketName,
        Key: objectKey,
        Body: file,
        ContentType: "image/svg+xml",
    })

    const response = await s3Client.send(commandImage)
    const imageUrl = `https://storage.amet.finance/${objectKey}`

    const metaInfo = {
        "name": "Dave Starbelly",
        "description": `This NFT represents ownership of an Amet Finance Zero Coupon Bonds (ZCB) bond. The bond consists of ${investmentAmount} in ${investmentToken} and offers ${interestAmount} in ${interestToken}. Redeemable after ${redeemLockPeriod} seconds, this NFT embodies trust in decentralized finance.\nMake sure token addresses match the expected tokens, as token symbols may be imitated. Verify the contract details and double-check before making any transactions.`,
        "external_url": `https://amet.finance/bonds/${_id}?chainId=${chainId}`,
        "image": imageUrl,
    }


    const commandJson = new PutObjectCommand({
        Bucket: bucketName,
        Key: `contracts/${toChecksumAddress(_id)}.json`,
        Body: JSON.stringify(metaInfo),
        ContentType: "application/json",
    })

    const responseJson = await s3Client.send(commandJson)
    console.log(`Updated the issuer contract`)

}


